function initMap(){const n={lat:59.938850840429865,lng:30.32307958505938},e=new google.maps.Map(document.getElementById("map"),{center:n,zoom:18});new google.maps.Marker({position:n,icon:"../img/map-pin.png",map:e})}document.addEventListener("DOMContentLoaded",(()=>{const n=document.querySelector(".main-nav"),e=document.querySelector(".main-nav__toggle");n.classList.remove("main-nav--nojs"),e.addEventListener("click",(function(){n.classList.contains("main-nav--closed")?(n.classList.remove("main-nav--closed"),n.classList.add("main-nav--opened")):(n.classList.remove("main-nav--opened"),n.classList.add("main-nav--closed"))}))}));